import React from 'react'
import style from './index.module.scss'
export default function index(props) {
  return (
    <div>
      <div className={style.navbar}>
        <div className={style.left}>
          {props.children[0]}
        </div>
        <div className={style.center}>
          {props.children[1]}
        </div>
        <div className={style.right}>
          {props.children[2]}
        </div>
      </div>
    </div>
  )
}
